function ptmDownloadPDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF('p', 'mm', 'a4');

    // Add Mosque Logo
    const logoBase64 = 'data:image/jpeg;base64,';
    doc.addImage(logoBase64, 'PNG', 10, 10, 50, 20); // Adjust position and size as needed

    // Add Title
    doc.setFontSize(16);
    doc.text('Prayer Times', 70, 20); // Adjust position as needed

    // Generate Table
    doc.autoTable({
        html: '#ptm-table',
        startY: 40, // Adjust to position the table below the title
        theme: 'grid',
        headStyles: {
            fillColor: [44, 140, 44], // Greenheader background
            textColor: 255, // White text
            fontSize: 8,
            halign: 'center',
            valign: 'middle'
        },
        bodyStyles: {
            fontSize: 8,
            halign: 'center',
            valign: 'middle'
        },
        alternateRowStyles: {
            fillColor: [240, 240, 240] // Light gray for alternate rows
        }
    });

    // Save PDF
    doc.save("Prayer-Times-" + ptm_vars.selectedMonth + '-' + ptm_vars.selectedYear + ".pdf");
}